import React, { useState } from 'react';
import './Career.css'; // Import the CSS file
import Footer from "../components/Footer";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'; // Import FontAwesomeIcon
import { faSearch, faMapMarkerAlt } from '@fortawesome/free-solid-svg-icons'; 


const Career = () => {
    const [searchTerm, setSearchTerm] = useState('');
    const [locationTerm, setLocationTerm] = useState('');
    const [results, setResults] = useState([]);
    const [hasSearched, setHasSearched] = useState(false); // Track if a search has been performed

    const mockData = [
        { title: 'Software Engineer', location: 'Redmond, WA', id: '12345' },
        { title: 'Product Manager', location: 'San Francisco, CA', id: '67890' },
        { title: 'Data Scientist', location: 'New York, NY', id: '11223' },
    ];

    const handleSearch = (e) => {
        e.preventDefault();
        setHasSearched(true); // Set hasSearched to true when the form is submitted

        const filteredResults = mockData.filter(
            (job) =>
                job.title.toLowerCase().includes(searchTerm.toLowerCase()) &&
                job.location.toLowerCase().includes(locationTerm.toLowerCase())
        );
        setResults(filteredResults);
    };

    return (
        <>
        <div>
        <header>
                <h1>Because impact matters</h1>
                <nav>
                    <form id="search-form" onSubmit={handleSearch}>
                        <div className="input-container">
                            <FontAwesomeIcon icon={faSearch} className="input-icon" />
                            <input
                                type="text"
                                placeholder="Search by job title, ID, or keyword"
                                value={searchTerm}
                                onChange={(e) => setSearchTerm(e.target.value)}
                            />
                        </div>
                        <div className="input-container">
                            <FontAwesomeIcon icon={faMapMarkerAlt} className="input-icon" />
                            <input
                                type="text"
                                placeholder="City, state, or country/region"
                                value={locationTerm}
                                onChange={(e) => setLocationTerm(e.target.value)}
                            />
                        </div>
                        <button type="submit">Search</button>
                    </form>
                </nav>
            </header>



            {/* Remove any unnecessary white box here */}
            {hasSearched && (
                <div id="search-results">
                    {results.length === 0 ? (
                        <p>No jobs found.</p>
                    ) : (
                        <ul>
                            {results.map((job) => (
                                <li key={job.id}>
                                    {job.title} - {job.location} (ID: {job.id})
                                </li>
                            ))}
                        </ul>
                    )}
                </div>
            )}

{/* Life at Our Company Sections */}
<section id="life-at-company">
                <h2>Life at Our Company</h2>

                {/* Benefits Section */}
                <div className="section">
                    <h3>Benefits</h3>
                    <p>Explore our world-class benefits designed to help you and your family live well.</p>
                </div>

                {/* Culture Section */}
                <div className="section">
                    <h3>Culture</h3>
                    <p>We will only achieve our mission if we live our culture, which starts with applying a growth mindset.</p>
                </div>

                {/* Diversity and Inclusion Section */}
                <div className="section">
                    <h3>Diversity and Inclusion</h3>
                    <p>
                        Learn more about our commitment to diversity and inclusion:
                        <a href="https://careers.microsoft.com/v2/global/en/culture/" target="_blank" rel="noopener noreferrer">
                            https://careers.microsoft.com/v2/global/en/culture/
                        </a>
                    </p>
                </div>

                {/* Flexible Work Section */}
                <div className="section">
                    <h3>Flexible Work</h3>
                    <ul>
                        <li>Flexible work hours</li>
                        <li>Remote work options</li>
                        <li>Work-life balance initiatives</li>
                    </ul>
                </div>
            </section>

        </div>
        <Footer/>
        </>
    );
};

export default Career;
